• Central Cairns location approx. 250 metres from the Cairns CBD;
• Harvey Norman and Freedom Furniture, considered one of Australia’s most successful retail showroom pairings, secure 66% of the centres income;
• Trade Area population of 229,920** has characteristics highly conducive to retail showroom spending;
• Lettable area of 15,287sqm* on a site area of 24,300 sqm*;
• Convenient ‘U-Shaped’ complex with 162 on grade car parks*;
• Centre WALE 4.1 years (by income)*;
• Fully leased net income $1,944,553*.

For sale by Expressions of Interest Closing: Friday 09th November 2012 at 12noon.

For more detailed information please contact the Exclusive Listing Agents.

**Urbis Sept 2012
